package dagger2.fym.org;
import android.os.Bundle;
import android.support.v7.app.AppCompatActivity;
import android.view.View;
import android.widget.Button;
import butterknife.BindView;
import butterknife.ButterKnife;
import butterknife.OnClick;
import mvp.data.DataManager;
import mvp.model.AddMemberCommon;
import mvp.model.CheckMemberCommon;
import mvp.model.DelMemberCommon;
import mvp.model.ModifyMemberCommon;

public class MainActivity extends AppCompatActivity {

    @BindView(R.id.btn_add)
    Button btnAdd;
    @BindView(R.id.btn_del)
    Button btnDel;
    @BindView(R.id.btn_mod)
    Button btnMod;
    @BindView(R.id.btn_check)
    Button btnCheck;
    DataManager dataManager;
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        ButterKnife.bind(this);
        dataManager = new DataManager();
    }

    @OnClick({R.id.btn_add, R.id.btn_del, R.id.btn_mod, R.id.btn_check})
    public void onClick(View view) {
        switch (view.getId()) {
            case R.id.btn_add:
                {
                    AddMemberCommon addMemberCommon = new AddMemberCommon();
                    addMemberCommon.setCompany_id("1");
                    addMemberCommon.setFace_image_data("");
                    addMemberCommon.setFace_image_type("jpg");
                    addMemberCommon.setMember_id("1");
                    dataManager.addMember(new AddMemberCommon());
                }
                break;
            case R.id.btn_del:
                {
                    DelMemberCommon delMemberCommon = new DelMemberCommon();
                    delMemberCommon.setCompany_id("1");
                    delMemberCommon.setMember_id("1");
                    dataManager.delMember(delMemberCommon);
                }
                break;
            case R.id.btn_mod:
                {

                    ModifyMemberCommon modifyMemberCommon = new ModifyMemberCommon();
                    modifyMemberCommon.setMember_id("1");
                    modifyMemberCommon.setCompany_id("1");
                    modifyMemberCommon.setFace_image_type("jpg");
                    modifyMemberCommon.setFace_image_data("");
                    dataManager.modifyMember(modifyMemberCommon);
                }
                break;
            case R.id.btn_check:
                {
                    CheckMemberCommon checkMemberCommon = new CheckMemberCommon();
                    checkMemberCommon.setFace_image_data("");
                    checkMemberCommon.setFace_image_type("jpg");
                    checkMemberCommon.setCompany_id("1");
                    dataManager.checkMember(checkMemberCommon);
                }
                break;
        }
    }
}
